function predictad_hideall_in_root(inPrefix, inRoot) {
    try {
        elem_array = predictad_findall_in_root(inPrefix, inRoot);
        if (elem_array != null && elem_array.length > 1) {
            for (i = 0; i < elem_array.length; i++) {
                elem_array[i].style.display = "none";
            }
        }
    } catch (e) { }
}
function predictad_findall_in_root(inPrefix, inRoot) {

    var elem_array = new Array;

    if (typeof inRoot.firstChild != 'undefined') {
        var elem = inRoot.firstChild;
        while (elem != null) {
            if (typeof elem.firstChild != 'undefined') {
                elem_array = elem_array.concat(predictad_findall_in_root(inPrefix, elem));
            }
            if (typeof elem.id != 'undefined') {
                var reg = new RegExp('^' + inPrefix + '.*');
                //if (elem.id.match(reg)) {
                if (elem.id == 'overlay') {
                    elem_array.push(elem);
                    //elem.style.display = "none";
                }
            }
            elem = elem.nextSibling;
        }
    }

    return elem_array;
}



